      date: new Date(2021, 1, 12),
    },
    {
      title: "Car Insurance",
      amount: 267.67,
      date: new Date(2021, 1, 12),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
